	public byte[] transformarEscalaGrises(byte[] image) throws IOException {
		ColorSpace espacioGrises = ColorSpace.getInstance(ColorSpace.CS_GRAY);
		ColorConvertOp ccop = new ColorConvertOp (espacioGrises, null);
		BufferedImage bImageFromConvert = EcontratoUtils.getBufferedImage(image);
		
		BufferedImage destino = ccop.filter(bImageFromConvert, null);
		return EcontratoUtils.getBytes(destino);
		
	}
	
