	public void doOCRPDFImages(String[] args,String pathFile) throws InvalidPasswordException, IOException, TesseractException {
		Date d1 = new Date();
		List<BufferedImage> l = PDFUtils.extraerImagenes(PDFUtils.readFile(new File(pathFile)) );
		
		ITesseract instance = new Tesseract();  // JNA Interface Mapping
        instance.setDatapath(args[0]); // path to tessdata directory
        instance.setLanguage("eng"); // eng
        
        instance.setTessVariable("tessedit_pageseg_mode", "11");
        
        ((Tesseract) instance).setHocr(false);
        
        Iterator<BufferedImage> it = l.iterator();
        
        
        while (it.hasNext()) {
        	String ocr = instance.doOCR(it.next()); //.replaceAll("\n", "");
        	LOGGER.info("texto=>[INICIO]{}[FIN]", ocr);
        }
        
        Date d2 = new Date();
        
        LOGGER.info("Tiempo: {} s", (d2.getTime() -d1.getTime())/1000);
	}
	
